pub struct ExcitationLevels {
    pub isotopes: Vec<(&'static str, Vec<f32>)>,
}

impl ExcitationLevels {
    pub fn new() -> Self {
        let isotopes = excitation_levels_nndc();
        ExcitationLevels { isotopes }
    }

    pub fn get(&self, isotope: &str) -> Option<Vec<f64>> {
        self.isotopes
            .iter()
            .find(|(name, _)| *name == isotope)
            .map(|(_, levels)| levels.iter().map(|&x| x as f64).collect())
    }
}

